import React, { Component } from "react";

class Toc extends Component {
  render() {
    console.log("Toc");
    const lists = [];
    const data = this.props.data;
    let i = 0;
    while (i < data.length) {
      lists.push(
        <li key={data[i].id}>
          <a
            href={"/content/" + data[i].id}
            onClick={(e) => {
              e.defaultPrevented();
              this.props.onChangePage();
            }}
          >
            {data[i].title}
          </a>
        </li>
      );
      i++;
    }
    return (
      <nav>
        <ul>{lists}</ul>
      </nav>
    );
  }
}

export default Toc;
